                    title: "3D \u0411\u0440\u043e\u043d\u044c \u0411\u0438\u043b\u0435\u0442\u043e\u0432",
                    desc: "\u0412\u044b\u0431\u043e\u0440 \u043c\u0435\u0441\u0442\u0430 \u043f\u0440\u044f\u043c\u043e \u043d\u0430 \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043c\u043e\u0434\u0435\u043b\u0438 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0430 \u043d\u0430 \u0431\u0430\u0437\u0435 Forge Viewer",
                    content: '<div>\n\n        <h1>\u0421\u0435\u0440\u0432\u0438\u0441 \u043f\u043e \u0432\u044b\u0431\u043e\u0440\u0443 \u0431\u0438\u043b\u0435\u0442\u043e\u0432 \u043d\u0430 \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u044f \u043d\u0430 \u0431\u0430\u0437\u0435 Autodesk Forge</h1>\n        <h6>\ud83c\udfc6 \u041f\u0440\u043e\u0435\u043a\u0442-\u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u044c \u0445\u0430\u043a\u0430\u0442\u043e\u043d\u0430 "\u041a\u0443\u0437\u043d\u0438\u0446\u0430 3D-\u0440\u0435\u0448\u0435\u043d\u0438\u0439" \u043e\u0442 Autodesk \u0432 2018 \u0433.</h6>\n        <h4>\u041f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0446\u0435\u043b\u044c:</h4>\n        <p>\u041f\u0440\u0438 \u0431\u0440\u043e\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0438 \u0431\u0438\u043b\u0435\u0442\u043e\u0432 \u043d\u0430 \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u044f, \u043f\u0440\u0438\u0432\u044b\u0447\u043d\u0430\u044f \u0434\u0432\u0443\u043c\u0435\u0440\u043d\u0430\u044f \u0441\u0445\u0435\u043c\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u043a\u0438 \u043d\u0435 \u043f\u0435\u0440\u0435\u0434\u0430\u0435\u0442 \u043f\u0440\u043e\u043f\u043e\u0440\u0446\u0438\u0438, \u043c\u0430\u0441\u0448\u0442\u0430\u0431\u044b \u0438 \u043c\u0435\u0440\u0442\u0432\u044b\u0435 \u0437\u043e\u043d\u044b. \u041f\u0435\u0440\u0435\u0445\u043e\u0434 \u043a \u0442\u0440\u0435\u0445\u043c\u0435\u0440\u043d\u043e\u0439 \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043c\u043e\u0434\u0435\u043b\u0438 \u043f\u0440\u0438\u0437\u0432\u0430\u043d \u0438\u0437\u0431\u0430\u0432\u0438\u0442\u044c\u0441\u044f \u043e\u0442 \u044d\u0442\u0438\u0445 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043a\u043e\u0432. \u041f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u0435\u0442 \u0441\u0435\u0440\u0432\u0438\u0441 \u043f\u043e \u0432\u044b\u0431\u043e\u0440\u0443 \u043c\u0435\u0441\u0442 \u0438 \u043f\u043e\u043a\u0443\u043f\u043a\u0435 \u0431\u0438\u043b\u0435\u0442\u043e\u0432 \u043d\u0430 \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043c\u0430\u0442\u0447.\n        </p>\n        <h4>\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u043c\u044b\u0435 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0438</h4>\n        <p>Autodesk Forge Viewer</p>\n        <h4>\u0421\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0435 \u0438\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0430:</h4>\n        <ol>\n        <li>\u041d\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u044f \u043f\u043e \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0443;</li>\n        <li>\u041a\u0440\u0430\u0442\u043a\u0438\u0435 \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u043f\u0440\u0438 \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u043d\u0430 \u0437\u0440\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0435 \u043c\u0435\u0441\u0442\u043e;</li>\n        <li>\u041a\u043e\u0440\u0437\u0438\u043d\u0430 \u0441 \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u0432 \u043d\u0435\u0435 \u043f\u0440\u0438 \u043d\u0430\u0436\u0430\u0442\u0438\u0438 \u0438 \u043a\u043d\u043e\u043f\u043a\u0430\u043c\u0438 \u043f\u0440\u0435\u0434\u043f\u0440\u043e\u0441\u043c\u043e\u0442\u0440\u0430.</li>\n        </ol>\n        <h4>\u0412\u0438\u0434\u0435\u043e-\u0434\u0435\u043c\u043e\u0441\u0442\u0440\u0430\u0446\u0438\u044f:</h4>\n        <p><iframe width="100%" height="400"  src="https://www.youtube.com/embed/6sybBIWMGck" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></p>\n        </div>'
